# Flatten the list of lists into a single list of transactions
transactions = [tx for sublist in input_data for tx in sublist]
total_transactions = len(transactions)

# Dictionary to keep track of transaction frequencies
transaction_counts = {}

# Iterate through the transactions
for transaction in transactions:
    # Count the frequency of each transaction
    if transaction in transaction_counts:
        transaction_counts[transaction] += 1
    else:
        transaction_counts[transaction] = 1

# Filter out transactions that are duplicated (count > 1)
duplicates_with_count = {tx: count for tx, count in transaction_counts.items() if count > 1}

# Calculate the total number of unique duplicates
unique_duplicates = len(duplicates_with_count)

# Calculate the percentage of duplicates
percentage_duplicates = (unique_duplicates / total_transactions) * 100 if total_transactions > 0 else 0

# Output the percentage of duplicates
print(f"Percentage of duplicate transactions: {percentage_duplicates:.2f}%")

# Output the duplicates with their counts
for tx, count in duplicates_with_count.items():
    print(f"Transaction {tx} is duplicated {count} times.")
